import React from "react";
import { SpinnerContainer, SpinnerOverlay } from "./spinnerStyles";

const Spinner = wrappedComponent => ({ isLoading, ...otherProps }) => {
  return isLoading ? (
    <SpinnerOverlay>
      <SpinnerContainer />
    </SpinnerOverlay>
  ) : (
    <wrappedComponent {...otherProps} />
  );
};

export default Spinner;
